import React from "react";
import ApexChart from "./PieChart";

function MainPage() {
  return (
    <>
      <div className="container">
        <div className="row">
          <div className="col">
            <div class="card" style={{ width: 10 }}>
              <div class="card-body">
                <ApexChart />
              </div>
            </div>
            {/* <ApexChart /> */}
          </div>
        </div>
      </div>
    </>
  );
}

export default MainPage;
